import logo from './logo.svg';
import './App.css';

function App() {
  function Lijst(){
    const list = [1,2,3,4]
    return(
      list.map()
    )
  }
  return (
    <div className="App">
      <header className="App-header">
        <p>
          hallo hallo hallo

        </p>
        <Lijst/>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
